import './App.css';
import styled from 'styled-components';
const Title = styled.h1 `
font-size: 1em; margin: 1em;
padding: 0.25em 1em; border:
2px solid palevioletred;
border-radius: 3px;
`; 


function Hello() {
  return (
   <div>
   <h1>Hello World!</h1>
   </div>
   );
  } 






function App() {
  return (
    <div className="App">
      <Title>
        <Hello />
      </Title>

    </div>
  );
}

export default App;
